import React, {Component} from 'react';
import {
  StyleSheet,View,Text,StatusBar,TouchableOpacity
} from 'react-native';
import UserMsgHeader from '../../components/user_msg_header'
import Container from '../../components/container'
import Images from '../../constants/images'
import MaterialIcons from 'react-native-vector-icons/MaterialIcons';

export default class Personal extends Component {
  constructor(props) {
    super(props)
  }
  /**
   *  构造视图列表
   */
  listViewBuilder() {
    const {navigate} = this.props.navigation
    return (
      <View>
        {
          [
            { icon: "assignment", title: "打卡记录",nextPage:"Myself" },
            { icon: "favorite-border", title: "兑换记录",nextPage:"Myself" },
            { icon: "settings", title: "基本信息",nextPage:"Myself" },
            { icon: "bookmark-border", title: "地址管理",nextPage:"Myself" },
            { icon: "exit-to-app", title: "退出登录" ,nextPage:"Myself"},
          ].map((item,index) => {
            return (
              <TouchableOpacity key={index} style={{ flexDirection: "row", justifyContent: "space-between", alignItems: "center" }} onPress={()=>navigate(item.nextPage)}>
                <View
                  color="red"
                  style={{
                    flexDirection: "row",
                    alignItems: "center",
                    paddingVertical: 20
                  }}
                >
                  <MaterialIcons
                      name={item.icon}
                      size={26}
                  />
                  <Text
                    style={{
                      fontWeight: "bold",
                      fontSize: 18,
                      paddingLeft:8,
                    }}
                  >
                      {item.title}
                  </Text>
                </View>
                  <MaterialIcons
                      name={'keyboard-arrow-right'}
                      size={26}
                  />
                </TouchableOpacity>
              )
          })
        }
      </View>
    )
  }
  render () {
    return (
      <Container style={{marginTop:StatusBar.currentHeight+20}}>
        <UserMsgHeader
           ptr={Images.mock.recordPtr}
           name="杨锐扬1"
           description="心之所向,吾之所往"
        />
        <View style={{flexDirection:"row",justifyContent:"space-around",marginVertical:20}}>
          <View>
            <Text style={styles.itemBox}>15</Text>
            <Text style={styles.itemTitle}>发布的</Text>
          </View>
          <View>
            <Text style={styles.itemBox}>15</Text>
            <Text style={styles.itemTitle}>发布的</Text>
          </View>
          <View>
            <Text style={styles.itemBox}>15</Text>
            <Text style={styles.itemTitle}>发布的</Text>
          </View>
       </View>
        {
          this.listViewBuilder()
        }
        {/* <View>

        </View> */}
      </Container>
    )
  }
}

const styles = StyleSheet.create({
  itemBox: {
    textAlign: "center",
    fontSize: 28,
    fontWeight: "bold",
    paddingVertical: 4,
    color:"#343635",
  },
  itemTitle: {
    color:"#c1c6c6"
  }
});
